import React from 'react';

const Controls = ({ onAIMove, onReset }) => {
    return (
        <div className="controls">
            <button onClick={onAIMove}>AI Move</button>
            <button onClick={onReset}>Reset Game</button>
        </div>
    );
};

export default Controls;
